import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import firebase from "firebase";

var config = {
  databaseURL: "https://sneh-33f7d-default-rtdb.firebaseio.com",
  projectId: "sneh-33f7d",
};
firebase.initializeApp(config);

class App extends React.Component {
  constructor(props){
    super(props);
    this.state={name: '', age: '', email: '', symptoms: ''};
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange(event) {
    this.setState({value: event.target.value});
  }
  render() {
    return (
      <form onsubmit={this.handleSubmit}>
      <input
        type="text"
        name="Name"
        onChange={this.changeHandler}
        placeholder="Name"
        value={this.state.item.name}
      />

      <input
        type="text"
        name="Age"
        onChange={this.changeHandler}
        placeholder="Age"
        value={this.state.item.age}
      />

      <button>Submit</button>
    </form>
    )
  }
}

handleSubmit = event => {
  event.preventDefault();
  write(this.state.item.name, this.state.item.age );
}

function write(name,age){
  firebase.database().ref('UsersList/').push({
      name,
      age
  }).then((data)=>{
      //success callback
      console.log('data ' , data)
  }).catch((error)=>{
      //error callback
      console.log('error ' , error)
  })
}
